import React from "react";
import Card from "react-bootstrap/Card";
import ListGroup from "react-bootstrap/ListGroup";
import { BsCalendarCheck } from "react-icons/bs";
import { AiOutlineClockCircle } from "react-icons/ai";

function MuzicaClasicaBody() {
  return (
    <Card
      class="mx-auto mb-5 mt-5"
      style={{ width: "50rem", justifyContent: "center" }}
    >
      <Card.Img
        variant="top"
        src="holder.js/100px180?text=Image cap"
        style={{ height: "200px" }}
        className="mb-5"
      />
      <Card.Body>
        <Card.Title>HAVASI Symphonic Concert Show</Card.Title>
        {/* <Card.Text>
          Some quick example text to build on the card title and make up the
          bulk of the card's content.
        </Card.Text> */}
      </Card.Body>
      <ListGroup className="list-group-flush">
        <ListGroup.Item>
          <BsCalendarCheck
            class="mx-auto me-2"
            style={{ alignContent: "center" }}
          />
          28 Decembrie
        </ListGroup.Item>
        <ListGroup.Item>
          {" "}
          <AiOutlineClockCircle class="mx-auto me-2" />
          18:00
        </ListGroup.Item>
        <ListGroup.Item>Vestibulum at eros</ListGroup.Item>
      </ListGroup>
      <Card.Body>
        <Card.Link href="#">Card Link</Card.Link>
        <Card.Link href="#">Another Link</Card.Link>
      </Card.Body>
    </Card>
  );
}

export default MuzicaClasicaBody;
